import React, { useState, useEffect } from "react";
import { Link, useNavigate } from "react-router-dom";
import { Facebook, Twitter, Instagram, User, ShoppingCart, Package, LogOut, Sun, Moon, Phone, Mail } from "lucide-react";

const Navbar = () => {
        const [isAuthenticated, setIsAuthenticated] = useState(false);
        const [isDropdownOpen, setIsDropdownOpen] = useState(false);
        const [darkMode, setDarkMode] = useState(localStorage.getItem("theme") === "dark");

        useEffect(() => {
                if (darkMode) {
                        document.documentElement.classList.add("dark");
                        localStorage.setItem("theme", "dark");
                } else {
                        document.documentElement.classList.remove("dark");
                        localStorage.setItem("theme", "light");
                }
        }, [darkMode]);

        const navigate = useNavigate();

        useEffect(() => {
                const checkAuth = () => {
                        const token = localStorage.getItem("userToken");
                        setIsAuthenticated(!!token);
                };

                checkAuth();
                window.addEventListener("storage", checkAuth);
                return () => window.removeEventListener("storage", checkAuth);
        }, []);

        const handleLogout = () => {
                localStorage.removeItem("userToken");
                window.dispatchEvent(new Event("storage"));
                navigate("/");
        };

        return (
                <nav className="bg-white shadow-md dark:bg-gray-900">
                        {/* Top Bar with Contact & Social Links */}
                        <div className="bg-[#f4efe8] text-sm py-2">
                                <div className="container mx-auto px-6 flex justify-between items-center">
                                        <div className="flex items-center space-x-4 text-gray-700">
                                                <Phone className="w-4 h-4" />
                                                <span>+123 456 7890</span>
                                                <Mail className="w-4 h-4 ml-4" />
                                                <span>support@jewelstore.com</span>
                                        </div>
                                        <div className="flex space-x-4 text-gray-700">
                                                <Facebook className="w-5 h-5 cursor-pointer hover:text-[#b76e79] transition" />
                                                <Twitter className="w-5 h-5 cursor-pointer hover:text-[#b76e79] transition" />
                                                <Instagram className="w-5 h-5 cursor-pointer hover:text-[#b76e79] transition" />
                                        </div>
                                </div>
                        </div>

                        {/* Main Navbar */}
                        <div className="max-w-7xl mx-auto px-6">
                                <div className="flex justify-between items-center h-20">
                                        {/* Logo */}
                                        <Link to="/">
                                                <img src="/logo.png" alt="JewelStore Logo" className="h-12" />
                                        </Link>

                                        {/* Navigation Links */}
                                        <div className="hidden md:flex space-x-8 text-gray-800 font-medium">
                                                <Link to="/" className="hover:text-[#b76e79] transition">Home</Link>
                                                <Link to="/products" className="hover:text-[#b76e79] transition">Products</Link>
                                                <Link to="/contact" className="hover:text-[#b76e79] transition">Contact</Link>
                                        </div>

                                        {/* User Actions */}
                                        <div className="flex items-center space-x-5">
                                                {isAuthenticated ? (
                                                        <>
                                                                {/* Profile Dropdown */}
                                                                <div className="relative">
                                                                        <button
                                                                                onClick={() => setIsDropdownOpen(!isDropdownOpen)}
                                                                                className="focus:outline-none relative"
                                                                        >
                                                                                <User className="w-6 h-6 text-gray-800 hover:text-[#b76e79] transition" />
                                                                        </button>
                                                                        {isDropdownOpen && (
                                                                                <div className="absolute right-0 w-44 bg-white shadow-lg rounded-lg py-2 mt-3 z-50">
                                                                                        <Link to="/profile" className="block px-4 py-2 hover:bg-gray-100">Profile</Link>
                                                                                        <Link to="/wishlist" className="block px-4 py-2 hover:bg-gray-100">Wishlist</Link>
                                                                                        <button
                                                                                                onClick={handleLogout}
                                                                                                className="block w-full text-left px-4 py-2 text-red-600 hover:bg-gray-100"
                                                                                        >
                                                                                                <LogOut className="w-4 h-4 inline-block mr-2" /> Logout
                                                                                        </button>
                                                                                </div>
                                                                        )}
                                                                </div>

                                                                {/* Cart & Orders */}
                                                                <Link to="/cart">
                                                                        <ShoppingCart className="w-6 h-6 text-gray-800 hover:text-[#b76e79] transition" />
                                                                </Link>
                                                                <Link to="/order-history">
                                                                        <Package className="w-6 h-6 text-gray-800 hover:text-[#b76e79] transition" />
                                                                </Link>
                                                        </>
                                                ) : (
                                                        <Link to="/login" className="px-5 py-2 bg-[#b76e79] text-white rounded-md hover:bg-[#9d5a64] transition">
                                                                Login
                                                        </Link>
                                                )}
                                        </div>
                                </div>
                        </div>
                </nav>

        );
};

export default Navbar;
